import './App.css';

import Header from './components/Header';
import Footer from './components/Footer';
import TodoList from './components/TodoList';
import TodoForm from './components/TodoForm';

function App() {
  return (
    <div className="App">
      <Header />

      <TodoList>
        <ul>
          <li>Todo 1</li>
          <li>Todo 2</li>
          <li>Todo 3</li>
        </ul>
      </TodoList>
      <Footer />
    </div>
  );
}

export default App;
